import request from './request.js'


export  function searchAllStudent(page,rows) {
 
   
    return request({
        url: "/student/"+page+"/"+rows,
        method: 'GET',
    })
}

export  function searchAllClass() {
 
   
    return request({
        url: "/class",
        method: 'GET',
    })
}
